import { Link } from "react-router-dom";
import classes from "./MainNavigation.module.css";
// import {useContext} from 'react';

function MainNavigation(props) {
  const logoutFunction = async function () {
    console.log("IDE MO MO MO");
    await fetch("http://127.0.0.1:8000/api/logout", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      credentials: "include",
    });

    props.setName("");
  };
  let login, register, logout;
  if (!props.name) {
    login = (
      <li>
        <Link to="/login">Login</Link>
      </li>
    );
    register = (
      <li>
        <Link to="/register">Register</Link>
      </li>
    );
  } else {
    logout = (
      <li onClick={logoutFunction}>
        <Link to="/">Logout</Link>
      </li>
    );
  }
  return (
    <header className={classes.header}>
      <div className={classes.logo}>React meetups</div>
      <nav>
        <ul>
          {login}
          {register}
          <li>
            <Link to="/all-fighters">All fighters</Link>
          </li>
          <li>
            <Link to="/new-fighter">Add new fighter</Link>
          </li>
          <li>
            <Link to="/new-tournament">Add new tournament</Link>
          </li>
          <li>
            <Link to="/all-tournaments">All tournaments</Link>
          </li>
          {logout}
        </ul>
      </nav>
    </header>
  );
}

export default MainNavigation;
